import {
  GET_MOVIES_ATTEMPT,
  GET_MOVIES_FAIL,
  GET_MOVIES_SUCCESS
} from './constants';

const getMoviesAttempt = () => ({
  type: GET_MOVIES_ATTEMPT
});

const getMoviesFail = (errorMessage) => ({
  type: GET_MOVIES_FAIL,
  errorMessage
});

const getMoviesSuccess = (payload) => ({
  type: GET_MOVIES_SUCCESS,
  payload
});

export default {
  getMoviesAttempt,
  getMoviesFail,
  getMoviesSuccess
};
